package common.rpa.model;

// TODO: Auto-generated Javadoc
/**
 * The Class Pruduct.
 *
 * @author yeestevez
 */
public class Product {
	
	/** ID del producto. */
	private long id;
	
	/** producto. */
	private String name;
	/**
	 * Datos obtenidos en la pagina
	 */
	private String data;
	/**
	 * precio
	 */
	private String price;
	/**
	 * Gets the name.
	 *
	 * @return the name
	 */
	public String getName() {
		return name;
	}

	/**
	 * Sets the name.
	 *
	 * @param name the new name
	 */
	public void setName(String name) {
		this.name = name;
	}

	/**
	 * Gets the id.
	 *
	 * @return the id
	 */
	public long getId() {
		return id;
	}

	/**
	 * Sets the id.
	 *
	 * @param id the new id
	 */
	public void setId(long id) {
		this.id = id;
	}

	/**
	 * @return the data
	 */
	public String getData() {
		return data;
	}

	/**
	 * @param data the data to set
	 */
	public void setData(String data) {
		this.data = data;
	}

	/**
	 * @return the price
	 */
	public String getPrice() {
		return price;
	}

	/**
	 * @param price the price to set
	 */
	public void setPrice(String price) {
		this.price = price;
	}


	
}
